import { Component } from '@angular/core';

@Component({
  selector: 'app-notadmin-header',
  templateUrl: './notadmin-header.component.html',
  styleUrls: ['./notadmin-header.component.css']
})
export class NotadminHeaderComponent {

}

<nav class="navbar navbar-light bg-secondary rounded-pill d-flex justify-content-evenly">
  <div class="container-fluid">
    <a routerLink="/user" style="color: white;"> <img src="assets/images/home-logo132.png"  style="width:130px;  " class="logo" routerLink="/user"></a>
    <div class="d-flex">
      <button routerLink="/login" class="btn btn-danger me-3" >Logout</button>
    </div>
  </div>
</nav>
